import { renderChooseLevelModal, appElement } from "../src/main.js";

export function loseRendor(timeSpent: number) {
    const minutes = Math.floor(timeSpent / 60);
    const remainingSeconds = timeSpent % 60;
    const formattedTime = `${String(minutes).padStart(2, "0")}:${String(remainingSeconds).padStart(2, "0")}`;
    if (!appElement) {
        console.error("Элемент appEl не найден.");
        return; // Выход из функции, если элемент не найден
    }
    const modalLoseHtml = `
        <div id="modal" class="modal">
            <div class="modal-content modal-content-win">
                <svg class="img_win" width="90.633057" height="90.633057" viewBox="0 0 90.6331 90.6331" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
	<desc>
			Created with Pixso.
	</desc>
	<defs>
		<pattern id="pattern_42_20" patternContentUnits="objectBoundingBox" width="1.000000" height="1.000000">
			<use xlink:href="#image42_2_0" transform="matrix(0.000343,0,0,0.000343,0,0)"/>
		</pattern>
		<image id="image42_2_0" width="2917.000000" height="2917.000000" xlink:href="data:image/png;base64,"/>
	</defs>
	<rect id="Image" width="90.633064" height="90.633057" fill="url(#pattern_42_20)" fill-opacity="1.000000"/>
</svg>

                <p class="text_win">Вы проиграли!</p>
                <p class="text_spendTime">Затраченное время:</p>
                <p class="spendTime">${formattedTime}</p>
                <button class="restart restart-again">Начать заново</button>
            </div>
        </div>
    `;
    appElement.innerHTML += modalLoseHtml;

    const restartBtn = document.querySelector(
        ".restart-again",
    ) as HTMLButtonElement;
    restartBtn.addEventListener("click", () => {
        if (appElement) {
            renderChooseLevelModal({ appEl: appElement });
        } else {
            console.error("Элемент с классом 'app' не найден.");
        }
    });
}
